  geom_segment(
    aes(x = 78.9, xend = 78.9, y = 15.1, yend = 15.3), 
    color = "grey70", linewidth = 0.1, inherit.aes = FALSE
  ) + 
  geom_segment(
    aes(x = 84.1, xend = 84.1, y = 15.1, yend = 15.3), 
    color = 'grey70', linewidth = 0.1, inherit.aes = FALSE
  ) 

# add plot caption to match what Tom has 
